public:
        AudioEffectCompressor() : AudioStream(3, inputQueueArray) {
        	disable();
        	setSideChain(0);
        	setDownSample(1);
        	setAttack(2);
        	setRelease(600);
        	setRatio(4);
        	setThreshold(-9);
        	setKnee(3);
        	setMakeupGain(0);
        	peakDet_prev = release_prev = 0;
        }
        
        void setSideChain(uint8_t _sideChain) {
        	if(_sideChain == sideChainSel) return;
        	if(_sideChain > 1) return;
        	else sideChainSel = _sideChain;
        }
        
        void setDownSample(uint8_t _downSample) {
        	if(_downSample == downSample) return;
        	if(_downSample > 8) downSample = 8;
        	else downSample = _downSample;
        }
        
        void setAttack(float _attack) {
        	// convert attack in mSec into q31 LPF coefficients
        	float alpha, temp;
        	int64_t temp2;
        	
        	if(_attack == attack_f) return;
        	if(_attack < 0.1) return;
        	if(_attack > 2000) return;
        	attack_f = _attack;
        	
        	alpha = exp(-1/(attack_f*44.1));        	
        	temp = (alpha * 2147483648.0f);
       		temp += temp > 0.0f ? 0.5f : -0.5f;
       		temp2 = (int64_t)temp;
       		alphaAttack = ((int32_t) (temp2 >> 32) != ((int32_t) temp2 >> 31)) ? ((0x7FFFFFFF ^ ((int32_t) (temp2 >> 63)))) : (int32_t) temp2;
       		alpha = 1 - exp(-1/(attack_f*44.1));        	
        	temp = (alpha * 2147483648.0f);
       		temp += temp > 0.0f ? 0.5f : -0.5f;
       		temp2 = (int64_t)temp;
       		alphaAttackComp = ((int32_t) (temp2 >> 32) != ((int32_t) temp2 >> 31)) ? ((0x7FFFFFFF ^ ((int32_t) (temp2 >> 63)))) : (int32_t) temp2;
        }
  
        void setRelease(float _release) {
        	// convert release in mSec into q31 LPF coefficients
        	float alpha, temp;
        	int64_t temp2;
        	if(_release == release_f) return;
        	if(_release < 0.1) return;
        	if(_release > 2000) return;
        	
        	release_f = _release;
        	
        	alpha = exp(-1/(release_f*44.1));        	
        	temp = (alpha * 2147483648.0f);
       		temp += temp > 0.0f ? 0.5f : -0.5f;
       		temp2 = (int64_t)temp;
       		alphaRelease = ((int32_t) (temp2 >> 32) != ((int32_t) temp2 >> 31)) ? ((0x7FFFFFFF ^ ((int32_t) (temp2 >> 63)))) : (int32_t) temp2;
       		alpha = 1 - exp(-1/(release_f*44.1));        	
        	temp = (alpha * 2147483648.0f);
       		temp += temp > 0.0f ? 0.5f : -0.5f;
       		temp2 = (int64_t)temp;
       		alphaReleaseComp = ((int32_t) (temp2 >> 32) != ((int32_t) temp2 >> 31)) ? ((0x7FFFFFFF ^ ((int32_t) (temp2 >> 63)))) : (int32_t) temp2;
        }
      
        void setRatio(float _ratio) {
        	if(_ratio == ratio) return;
		if(_ratio < 1) return;
		if(_ratio > 32767) return;
		ratio = _ratio;
		
		ratio_resip = (1 / ratio) - 1;
        }
        
        void setKnee(float _knee) {
        	if(_knee == knee) return;
        	if(_knee < 0) return;
        	if(_knee >= 40) return;
		knee = _knee;
		
		knee_div_2 = knee / 2;
		knee_x_2 = knee * 2;
	}
	
	void setThreshold(float _thresh) {
		if(_thresh == thresh) return;
		if(_thresh <= -40) return;
		if(_thresh > 0) return;
		thresh = _thresh;
	}
	
	void setMakeupGain(float _makeupGain) {
		float voltGain;
		
		if(_makeupGain == makeupGain_f) return;
		if(_makeupGain < 0) return;
		if(_makeupGain >= 40) return;
		makeupGain_f = _makeupGain;
		
		voltGain = powf(10,makeupGain_f/20);
		makeupGain = voltGain * 65536;	
	}
	
	void enable() { if(!enabled) enabled = true;}
	
	void disable() { if(enabled) enabled = false;}
          
     
        virtual void update(void);
        
        
        
